import React, { useState } from "react";
import { Select } from "@material-ui/core";

function Dropdown() {
  const [country, setCountry] = useState(["Somalia", "Kenya"]);

  function handleChange() {
    return country;
  }

  return <Select options={"Hassan"}></Select>;
}

export default Dropdown;
